import Foundation

/**
 所有 DNA 由一系列缩写为 A，C，G 和 T 的核苷酸组成，例如：“ACGAATTCCG”。在研究 DNA 时，识别 DNA 中的重复序列有时会对研究非常有帮助。
 
 编写一个函数来查找 DNA 分子中所有出现超多一次的10个字母长的序列（子串）。
 
 示例:
 ````
 输入: s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"
 
 输出: ["AAAAACCCCC", "CCCCCAAAAA"]
 ````
 */
class Solution187: SolutionDelegate {
    
    func soluction(s: String) -> [String] {
        guard s.count > 10 else { return [] }
        var dict = Dictionary<String, Int>()
        
        var start = s.startIndex
        var end = s.index(start, offsetBy: 9)
        while end != s.endIndex {
            let substr = String(s[start...end])
            print(substr.count)
            if let value = dict[substr] {
                dict[substr] = 1 + value
            } else {
                dict[substr] = 0
            }
            
            start = s.index(start, offsetBy: 1)
            end = s.index(end, offsetBy: 1)
        }
        
        return dict.filter({ (key, value) -> Bool in
            return value > 1
        }).map({ (key, value) -> String in
            return key
        })
    }
    
    func runSolution() {
        print(soluction(s: s))
    }
    
    //    let s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"
    //    let s = ""
    //    let s = "AAAAAAAAAAA"
    let s = ""
}
